import ajax from '../ajax'
const BASE = '/admin/carriage'

// 车厢列表
export const listCarriage = (pageNum, pageSize, key) => ajax(BASE + '/list', { pageNum, pageSize, key })
// 添加车厢
export const addCarriage = (carriage) => ajax(BASE + '/add', carriage, 'POST')
